import React from 'react';
import { Link } from "react-router-dom";
import styled from 'styled-components';

function Register2() {
    return (
        <div>
            <Form id="register-form">
                <Label for="e-mail">E-Mail</Label><br/>
                <Input type="e-mail" id="e-mail" name="e-mail" placeholder="Enter your E-Mail"/><br/>
                <Label for="password">Password</Label><br/>
                <Input type="text" id="password" name="first-name" placeholder="Enter First Name"/><br/>
                <Label for="last-name">Confirm Password</Label><br/>
                <Input type="text" id="confirm-password" name="last-name" placeholder="Enter Last Name"/><br/>

                <Link to="/">
                    <Button>Next</Button>
                </Link>
            </Form>


        </div>
    )
}

export default Register2;
